import React from 'react';
import ReactModal from 'react-modal';
import { useState, useEffect } from 'react';

const Footer = () => {

    const [isModalOpen, setIsModalOpen] = useState(false);

    const openModal = () => {
        setIsModalOpen(true);
        console.log('ok')
    };

    const closeModal = () => {
        setIsModalOpen(false);
    };

    useEffect(() => {
        ReactModal.setAppElement('body');
    }, []);

    return (
        <div className="Footer">
            <div className="horaireGarage">
                <table>
                    <tr>
                        <td>Lundi :</td>
                        <td>08h45 - 12h00, 14h00 - 18h00</td>
                    </tr>
                    <tr>
                        <td>Mardi :</td>
                        <td>08h45 - 12h00, 14h00 - 18h00</td>
                    </tr>
                    <tr>
                        <td>Mercredi :</td>
                        <td>08h45 - 12h00, 14h00 - 18h00</td>
                    </tr>
                    <tr>
                        <td>Jeudi :</td>
                        <td>08h45 - 12h00, 14h00 - 18h00</td>
                    </tr>
                    <tr>
                        <td>Vendredi :</td>
                        <td>08h45 - 12h00, 14h00 - 18h00</td>
                    </tr>
                    <tr>
                        <td>Samedi :</td>
                        <td>08h45 - 12h00</td>
                    </tr>
                    <tr>
                        <td>Dimanche :</td>
                        <td>Fermé</td>
                    </tr>
                </table>
            </div>
            {/*<span className="modalRdv" onClick={openModal}>Je prends rendez-vous</span>*/}
            <ReactModal
                isOpen={isModalOpen}
                onRequestClose={closeModal}
            >


            </ReactModal>
        </div>
    );
};

export default Footer;
